import styles from "./Navbar.module.css";
import { Link } from "react-router-dom";
import logo from "../../assets/Group24.svg";
import iconUser from "../../assets/icons/account_circle_black_24dp.svg";
import iconSales from "../../assets/icons/receipt_black_24dp.svg";
import iconLogout from "../../assets/icons/logout_black_24dp.svg";

const Navbar = () => {
  return (
    <header className={styles.container}>
      <img className={styles.logoImg} src={logo} alt="logo" />
      <nav className={styles.containerNav}>
        <label>
          <Link to="/home/user">
            <img src="" alt="" />
            USUÁRIOS
          </Link>
        </label>
        <label>
          <Link to="/home/vendas">
            <img src="" alt="" />
            VENDAS
          </Link>
        </label>
        <label>
          <Link>
            <img src="" alt="" />
            LOG OUT
          </Link>
        </label>
      </nav>
    </header>
  );
};

export default Navbar;
